Actionscript.script:
onClipEvent (load) {
	var 自机 = _parent._parent._parent;
	if (自机.脸型 != undefined)
	{
		this.基本款._visible = 0;
		_root.装备引用配置.配置装扮(this,自机.脸型,"装扮","脸型_引用");
	}

	_root.装备引用配置.配置装扮(this,自机.发型,"装扮2","发型_引用");
	_root.装备引用配置.配置装扮(this,自机.面具,"装扮3","面具_引用");
}
